import React from 'react';
import ChattingContainer from '../containers/Chatting/ChattingContainer';
import HeaderContainer from '../containers/common/HeaderContainer';

const ChattingPage = () => {
  return (
    <>
      <HeaderContainer />
      <ChattingContainer />
    </>
  );
};
export default ChattingPage;
